import React from 'react'
import './CreatePopup.css'
function CreatePopup() {
  return (
    <div className='bg-popup'>
        <div className='popup-box'>
            <h2>ข้อมูลประเด็นโต้แย้ง</h2>
        </div>
    </div>
  )
}

export default CreatePopup
